import React from 'react';
import './App.css';
import axios from 'axios';
import { Button, IconButton } from '@material-ui/core';
import ArchiveIcon from '@material-ui/icons/Archive';
import WarningIcon from '@material-ui/icons/Warning';
import DeleteIcon from '@material-ui/icons/Delete';
import MarkunreadIcon from '@material-ui/icons/Markunread';
import SnoozeIcon from '@material-ui/icons/Snooze';
import MoveToInboxIcon from '@material-ui/icons/MoveToInbox';
import LabelIcon from '@material-ui/icons/Label';
import MoreVertIcon from '@material-ui/icons/MoreVert';

class Test extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: "",
            show: false
        }
    }

    handleShow = (e) => {
        console.log(e.currentTarget.id);
        this.setState({
            show: true
        })
    }

    handleHide = (e) => {
        console.log(e.currentTarget.id);
        this.setState({
            show: false
        })
        axios({
            method: 'post',
            url: 'http://localhost:8080/greeting',
            data: {
                id: 4,
                content: "Ann"
            }
        })
    }

    componentDidMount() {
        axios.get('http://localhost:8080/greeting')
            .then((response) => {
                console.log(response)
                this.setState({
                    data: response.data.content
                })
            });
    }

    render() {
        return (
            <div>
                <Button id="1" align="left" variant="contained" onClick={this.handleShow}>Show</Button>
                <Button id="2" align="right" variant="contained" onClick={this.handleHide}>Hide</Button>
                {this.state.show && <h1>{this.state.data}</h1>}
                <br/>
                <IconButton aria-label="archive"><ArchiveIcon/></IconButton><br/>
                <IconButton aria-label="Warning"><WarningIcon/></IconButton>
                <IconButton aria-label="Delete"><DeleteIcon/></IconButton>
                <IconButton aria-label="Unread"><MarkunreadIcon/></IconButton>
                <IconButton aria-label="Snooze"><SnoozeIcon/></IconButton>
                <IconButton aria-label="Move"><MoveToInboxIcon/></IconButton>
                <IconButton aria-label="Label"><LabelIcon/></IconButton>
                <IconButton aria-label="More"><MoreVertIcon/></IconButton>
            </div>
        );
    }
}

export default Test;
